import './App.css';
import React from 'react';
import ChatBot from 'react-simple-chatbot';
import { Segment } from 'semantic-ui-react';
import { ThemeProvider } from "styled-components";

const steps = [
  {
    id: '0',
    message: 'Hey Geek!',
    trigger: '1'
  },
  {
    id: '1',
    message: 'Hey Hello!',
    trigger: '2'
  },
  {
    id: '2',
    message: 'Hey Hello!',
    trigger: '3'
  },
  {
    id: '2',
    message: 'Hey Hello!',
    end: true
  },
];




function App() {
  return (
    <div className="App">
      <h1>Welcome to Geeksforgeeks</h1>
      <ChatBot steps={steps} />
    </div>
  );
}


export default App;
